import React from 'react';


const Header = () => {
  return (
    <div className='header'>
      <div className='logo'>Movie App</div>
      <div className='user-image'>
        <img src='https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.klipartz.com%2Fen%2Fsearch%3Fq%3Duser&psig=AOvVaw2mC63uCBwLswVCB-HD2hiI&ust=1718102720750000&source=images&cd=vfe&opi=89978449&ved=0CBIQjRxqFwoTCLjG1cbt0IYDFQAAAAAdAAAAABAE' alt="user" />
      </div>
    </div>
  );
}

export default Header;
